import React from 'react'
import './Home.css';
import Homepage from '../Homepage/img/11.jpg';

export default function Home() {
  return (
    <>
    <div classname="row">
  <div classname="column">
    <img src={Homepage} alt="Snow" />
  </div>
  <div classname="column">
    <img src="12.png" alt="Forest" />
  </div>
  <div classname="column">
    <img src="13.jpg" alt="Mountains" />
  </div>
</div>
    </>
  )
}
